  -- "Symbol","Name","LastSale","MarketCap","IPOyear","Sector","industry","Summary Quote",
  
INSERT INTO [equity_staging].[symbol]
           ([exchange]
           ,[symbol]
           ,[name]
           ,[last_sale]
           ,[market_cap]
           ,[ipo_year]
           ,[sector]
           ,[industry]
           ,[summary_quote])
	select N'nasdaq'											 as [exchange]
		   , t.c.value(N'./Cell[1]/Data[1]', N'[nvarchar](500)') as [symbol]
		   , t.c.value(N'./Cell[2]/Data[1]', N'[nvarchar](500)') as [name]
		   , t.c.value(N'./Cell[3]/Data[1]', N'[nvarchar](500)') as [last_sale]
		   , t.c.value(N'./Cell[4]/Data[1]', N'[nvarchar](500)') as [market_cap]
		   , t.c.value(N'./Cell[5]/Data[1]', N'[nvarchar](500)') as [ipo_year]
		   , t.c.value(N'./Cell[6]/Data[1]', N'[nvarchar](500)') as [sector]
		   , t.c.value(N'./Cell[7]/Data[1]', N'[nvarchar](500)') as [industry]
		   , t.c.value(N'./Cell[8]/Data[1]', N'[nvarchar](500)') as [summary_quote]
	from   @nasdaq.nodes(N'/Table/Row') as t(c)
	order by [symbol]; 
